import axios from 'axios'

const deleteRequest = (expression, result) => axios.delete('/', {
  headers: {
    'Content-Type': 'application/json',
  },
  data: {
    body: JSON.stringify({
      expression,
      result,
    }),
  },
})

export default deleteRequest
